import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';


const RegisterFormPage = () => {
    return(
        <>
         <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        alignItems:'center',
        '& .MuiTextField-root': { width: '25ch' },
      }}
    >
      <h1>Welcome to Sign up Page:</h1>
      <TextField type="text" label={'Name="username"'} id="margin-normal" margin="normal" />
      <TextField type="email" label={'Email="email"'} id="margin-normal" margin="normal" />
      <TextField type="password" label={'Password="password"'} id="margin-normal" margin="normal" />
      <Button variant="contained">Register</Button>
      <h2>OR</h2>
      <Button variant="contained">Log In</Button>
    </Box>
        </>
    )
}

export default RegisterFormPage;
